import React, { Component } from 'react'
import './Header.css'

export class Header extends Component {
    render() {
        return (
            <div className="navbar">
                <a className="active" href="#"> Home</a>
                <a href="#"> Search</a>
                <a href="#"> Contact</a>
                <a href="#"> Login</a>
            </div>
        )
    }
}

export default Header
